  async presentToast(message: string, time: number = 1500) {
    const toast = await this.toastController.create({
      message: message,
      duration: time
    });
    toast.present();
  }

  async selectPageSize(bill: Bill) {
    const alert = await this.alertController.create({
      header: 'Select page size',
      buttons: [
        {
          text: 'A5',
          handler: () => {
            this.makePdf(bill, 'A5')
          }
        },
        {
          text: '6x4',
          handler: () => {
            this.makePdf(bill, '6x4');
          }
        }
      ]
    });
    await alert.present();
  }

